const lancamentos = [{
   titulo:"Free Guy: Assumindo o controle",
   poster:"data:image/jpeg;base64,",
   link:"https://superflixapi.dev/filme/tt6264654"},{
   titulo:"Um lugar silÃªncioso: Dia um",
   poster:"data:image/jpeg;base64,",
   link:"https://superflixapi.dev/filme/tt13433802"
}]

function gerarLancamentos() {
    const container = document.getElementById('lancamentoContainer');
    lancamentos.forEach(lancamento => {
        const linkElement = document.createElement('a');
        linkElement.href = `player03.html?video=${encodeURIComponent(lancamento.link)}`;
        linkElement.target = "_blank"; 

        const imgElement = document.createElement('img');
        imgElement.src = lancamento.poster; 
        imgElement.alt = `Poster de ${lancamento.titulo}`;
        imgElement.classList.add('poster');

        linkElement.appendChild(imgElement);
        container.appendChild(linkElement);
    });
}

document.addEventListener('DOMContentLoaded', gerarLancamentos);
